import React, { Component } from 'react'
import './App.css';

import navBar from './components/navBar'
// import 'bootstrap/dist/css/bootstrap.min.css';

class App2 extends Component { // name your components with an uppercase letter in react or else it will not reconize them
    render() {
        return (
            <>
                <div>
                    {navBar}
                </div>
            </>
        )
    }
}

export default App2;
